import React from 'react';
import './Form.css';
import text869 from './g6682.png';
import fondo2 from './64857.jpg';

const Form  = () => {
  return (

    <div className="flex items-center center f1-ns tc blue  artbg " >

    <div className="flex flex-wrap justify-content items-center center" >

      <div className="flex flex-column w-50 items-center">
        <div className=" pa3">

          <h1 className="font ">Conversemos</h1>
          <p className="f3  center" >Tus ideas, la podemos desarrollar y plasmar en algo concreto y funcional.
          </p>
        </div>
        <div className=" tl ">
          <img className="pa3" src={text869} alt=""/>
        </div>

      </div>

      <div className="flex flex-column w-50 items-center">
       <div className=" pa3">

         <h1 className="font ">Nosotros</h1>
         <p className="f3 center ">Descubre un poco mas de nosotros.
         </p>
       </div>

       <div className=" tl ">
         <img className="pa3" src={text869} alt=""/>
       </div>

      </div>


     </div>

  </div>




  );


}

export default Form;
